import './App.css';
import NavBar from './Components/Navbar/Navbar';
import { BrowserRouter,Route,Router,Routes } from 'react-router-dom';
import { Shop } from './Pages/Shop';
import { Shopcat } from './Pages/Shopcat';
function App() {
  return (
    <div >
    <BrowserRouter>
      <NavBar/>
      <Routes>
         <Route path = "/" element={<Shop/>}/>
         <Route path ='/apple' element={<Shopcat category="apple"/>}/>
         <Route path= '/samsung' element = {<Shopcat category="samsung"/>}/>
         <Route path= '/nothing' element = {<Shopcat category="nothing"/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
